import React from "react";

export default function Filme({movie}) {
  //console.log(movie);
  return (
    <>
    {
      movie.map((el, i) => (
        <div key={ i }>
          <p>{el.title}</p>
          <p>{el.opening_crawl}</p>
          <p>{el.director}</p>
          <p>{el.producer}</p>
          <p>{el.release_date}</p>
          <p>{el.created}</p>
          <p>{el.edited}</p>
          <p>{el.url}</p>
        </div>
      ))
    }
        {/*<h1>{movie.titulo}</h1>*/}
    </>
  );
}
